import { Component } from '@angular/core';

interface Glosario {
  [key: string]: string[];
}

@Component({
  selector: 'app-glosario',
  templateUrl: './glosario.component.html',
  styleUrls: ['./glosario.component.css']
})
export class GlosarioComponent {
  glosario: Glosario = {
    'A': ['Abdomen', 'Axila', 'Anatomía'],
    'B': ['Brazo', 'Boca', 'Biología'],
    'C': ['Cabeza', 'Cuello', 'Corazón'],
    // Agrega más letras y palabras según tu glosario
  };
  seleccionActual: string = 'A'; // Letra inicial seleccionada
  informacionLetra: string[] = this.glosario[this.seleccionActual]; // Información de la letra seleccionada

  // Método para cambiar la selección de letra
  seleccionarLetra(letra: string) {
    this.seleccionActual = letra;
  }



  searchText: any;
  onSearchChange() {
    console.log(this.searchText);
    // Aquí puedes manejar la entrada del usuario
    // Por ejemplo, puedes realizar una solicitud HTTP para buscar los datos
  }
}
<!-- HEADER -->
<app-medicina-header></app-medicina-header>

<div class="linea text-center" id="cont">
  <h1 class="texto">GLOSARIO</h1>
</div>

<div class="d-flex justify-content-end">
  <form class="form-inline my-2 my-lg-0">
    <input class="form-control mr-sm-2" [(ngModel)]="searchText" (ngModelChange)="onSearchChange()" type="search"
      placeholder="Buscar" aria-label="Buscar">
  </form>
</div>
<div class="d-flex justify-content-center align-items-center carousel">
  <carousel [isAnimated]="false">
    <slide *ngFor="let letra of glosario | keyvalue">
      <div class="carousel-caption">
        <ul class="letras-lista">
          <li [class.active]="letra.key === seleccionActual" (click)="seleccionarLetra(letra.key)">
            {{ letra.key }}
          </li>
        </ul>
      </div>
      <div class="carousel-body" id="letra">
        {{ letra.key }}
      </div>
    </slide>
    <ng-template carouselControl>
      <button type="button" class="carousel-control-prev" aria-label="Previous">
        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
      </button>
      <button type="button" class="carousel-control-next" aria-label="Next">
        <span class="carousel-control-next-icon" aria-hidden="true"></span>
      </button>
    </ng-template>
  </carousel>
</div>

<div class="informacion-letra">
  <h2 *ngIf="letra.key === seleccionActual">Información sobre la letra {{ seleccionActual }}</h2>
  <ul *ngIf="letra.key === seleccionActual">
    <li *ngFor="let palabra of glosario[seleccionActual]">{{ palabra }}</li>
  </ul>
</div>


<!-- FOOTER -->
<app-medicina-footer></app-medicina-footer>
